import React, { Component } from "react";
import { withStyles } from "@material-ui/core/styles";
import Button from "@material-ui/core/Button";
import { Animated } from "react-animated-css";
import Toolbar from "@material-ui/core/Toolbar";
import { relative } from "path";

const styles = {
  header: {
    color: "#E040FB",
    fontFamily: "Righteous",
    fontWeight: "bold",
    fontSize: "3.5vmax",
    position: "relative",
    bottom: "70px",
    marginBottom: "5rem"
  },
  grid: {
    display: "flex",
    flexDirection: "column",
    justifyItems: "center",
    position: "relative",
    bottom: "80px"
  },
  text: {
    color: "#30323e",
    fontFamily: "Quicksand",
    backgroundColor: "rgba(216, 220, 242, 0.6)",
    fontWeight: "bold",
    padding: 30,
    marginTop: 50
  },
  home: {
    color: "#d8dcf2",
    fontSize: "2rem",
    fontFamily: "Lobster, cursive",
    textDecoration: "underline",
    textDecorationColor: "#e040fb"
  },
  body: {
    position: "relative",
    top: 100
  },
  all: {
    backgroundColor: "#212127d3",
    borderRadius: "5%",
    margin: 30
  },
  info: {
    color: "#d8dcf2",
    fontFamily: "Quicksand",
    fontWeight: "bold",
    fontSize: "3vmax",
    position: "relative",
    bottom: "100px"
  },
  picture: {
    maxWidth: "100%",
    maxHeight: "100vh",
    margin: "auto",
    position: "relative",
    bottom: 70
  },
  button1: {
    position: "relative",
    top: 50,
    backgroundColor: "#e040fb",
    marginBottom: 70,
    margin: 50,
    width: 300,
    height: 50
  },
  button2: {
    position: "relative",
    top: 50,
    marginBottom: 70,
    margin: 50,
    width: 300,
    height: 50
  },
  links: {
    float: "left",
    display: "inline-flex",
    position: "relative",
    bottom: 50
  },
  link: {
    color: "#d8dcf2",
    marginRight: 20
  }
};

class SpacexResult extends Component {
  render() {
    const { classes } = this.props;

    return (
      <React.Fragment>
        <Toolbar>
          <Animated
            animationIn="fadeInRight"
            animationOut="fadeOut"
            isVisible={true}
          >
            <Button className={classes.home} href="/">
              Universa Localis
            </Button>
          </Animated>
        </Toolbar>

        <div className={classes.all}>
          <div className={classes.body}>
            <h1 className={classes.header}>
              Mission Name: {this.props.receivedInfo.mission_name}
            </h1>
            <div className={classes.links}>
              <Button
                variant="outlined"
                className={classes.link}
                href={this.props.receivedInfo.article_link}
                target="_blank"
              >
                Article
              </Button>
              <Button
                variant="outlined"
                className={classes.link}
                href={this.props.receivedInfo.video_link}
                target="_blank"
              >
                Video
              </Button>
              <Button
                variant="outlined"
                className={classes.link}
                href={this.props.receivedInfo.wikipedia}
                target="_blank"
              >
                Wikipedia
              </Button>
            </div>
            <h3 className={classes.info}>
              Launch Year: {this.props.receivedInfo.launch_year}
            </h3>
            <h3 className={classes.info}>
              Rocket Name: {this.props.receivedInfo.rocket_name}
            </h3>
            <img
              className={classes.picture}
              src={this.props.receivedInfo.mission_patch}
              alt=""
            />
          </div>
          <Button
            className={classes.button1}
            variant="contained"
            color="primary"
            href="spacex"
          >
            Show Another Patch
          </Button>
          <Button
            className={classes.button2}
            variant="contained"
            color="primary"
            href="/"
          >
            Go Back
          </Button>
        </div>
      </React.Fragment>
    );
  }
}

export default withStyles(styles)(SpacexResult);
